import React from 'react';
import styled from 'styled-components';
import PinterestIcon from '@material-ui/icons/Pinterest';
import IconButton from '@material-ui/core/IconButton';

const Wrapper = styled.div`
display:flex;
align-items:center;
height: 56px;
padding: 12px 4px 4px 16px;
background-color:white;
color:black;
`;

const LogoWrapper = styled.div`
.MuiSvgIcon-root {
    color: #eb090f;
    font-size: 32px;
    cursor:pointer;
}
`;

const HomeButton = styled.div`
    display:flex;
    align-items:center;
    justify-content: center;
    height: 48px;
    min-width: 123px;
    border-radius: 24px;

`;

const HomePageButton = styled.div`
    display:flex;
    align-items:center;
    justify-content: center;
    height: 48px;
    min-width: 123px;
    border-radius: 24px;
    cursor: pointer;
    background-color: rgb(17,17,17);

    a{
        text-decoration: none;
        color: white;
        font-weight: 700;
    }
`;

const FollowingButton = styled.div`
    display:flex;
    align-items:center;
    justify-content: center;
    height: 48px;
    min-width: 123px;
    border-radius: 24px;
    cursor: pointer;
    background-color: white;

    a{
        text-decoration: none;
        color: black;
        font-weight: 700;
    }

    :hover{
        background-color: #e1e1e1;
    }
`;




export const Header = () => {
    return (
        <Wrapper>
            <LogoWrapper>
                <IconButton>
                    <PinterestIcon />
                </IconButton>
            </LogoWrapper>
            <HomePageButton>
                <a href="/">Homepage</a>
            </HomePageButton>

            <FollowingButton>
                <a href="/">Following</a>
            </FollowingButton>
            {/*     
            <SearchWrapper>
                <SearchBarWrapper>

                </SearchBarWrapper>

            </SearchWrapper>

            <IconsWrapper>


            </IconsWrapper> */}
        </Wrapper>
    );
};

export default Header;
